import React from 'react';
import {Routes, Route, useNavigate} from 'react-router-dom';

export default function Home(){
    const navigate = useNavigate();

    const navigateToSpring = () => {
        navigate('./spring/Flower-Match.js');
    }

    return(
        <div>
            <h1>Hi! Home page</h1>
            <button onClick = {navigateToSpring}>Go to spring</button>

            <Routes>
                <Route path = './spring/Flower-Match.js' element = {<flower/>}/>
            </Routes>
        </div>
    )
}
